import Expense from "./components/ExpenseItem";

function App() {

  const expenses = [
    {title : 'Car Insuarance', 
    amount: 293.67, 
    date : new Date(2021,2,28)},
    {title : 'EMI',
     amount: 203.67, 
     date : new Date(2021,2,1)},
    {title : 'Shopping', 
    amount: 103.67, 
    date : new Date(2021,4,3)},
  ];

  return (
    <div>
      <h2>Let's get started!</h2>
      <Expense title></Expense>
      <Expense></Expense>
      <Expense></Expense>
    </div>
  );
}

export default App;
